import styles from "./styles.module.css";
import React, { useState, useEffect } from "react";
import PassengerBall from "../objects/PassengerBall";

function Passenger(props, container) {
  const [passengers, setPassengers] = useState([]);

  useEffect(() => {
    const newPassengers = [];
    for (let i = 0; i < props.numPassengers; i++) {
      newPassengers.push(<PassengerBall key={i} container={container} />);
    }
    setPassengers(newPassengers);
  }, [props.numPassengers]);

  return <div>{passengers}</div>;
}
export default Passenger;
